import React from "react";
import habit from '../src/Images/goodhabbits.jpg';


const Habbits = () =>{
 


    return (
        <>  
        <div className="abou_page">
            <div className="section">
            <div className="content_area">
            <div className="text">
            <h2>Welcome!</h2>
             <p>Here iam provided projects done by my self</p>
                </div>
                <div className= 'side_img'>
                <img  src={habit} alt="cg" />

                </div>
                </div>
                    </div>
                    </div>
        </>
    )
}
export default Habbits;
